pragma solidity ^0.5.10;

import "../permissions/AuthChecker.sol";

contract AuthTestMock is AuthChecker {

    uint256 public valOne;
    uint256 public valTwo;

    // solhint-disable-next-line no-empty-blocks
    constructor(address guard) public AuthChecker(guard) {}

    function authOne(uint256 _valOne)
        public
        onlyAuthorized
    {
        valOne = _valOne;
    }

    function authTwo(uint256 _valTwo)
        public
        onlyAuthorized
    {
        valTwo = _valTwo;
    }

    function authAny()
        public
        onlyAuthorized
    {
        valOne = valTwo;
    }

    function reset() public {
        valOne = 0;
        valTwo = 0;
    }

}
